INSERT INTO `datafeed` VALUES ('55238', '4956', 'AGV Helmets', 'AGV Numo Hi-Viz Helmet', '0100-1118', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/agv-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>\r\n<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>AGV Numo Hi-Viz Helmet</strong></span></p>\r\n<p><span style=\"font-size: small;\">The&nbsp;<strong>AGV Numo</strong>&nbsp;flip front lid is perfect for the serious rider, the everyday commuter and the continental tourer. Complete with internal sun visor among many other wonderful features, the AGV Numo is certainly a lid to consider for this riding season.</span></p>\r\n<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Features</strong><strong>:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">HIR-TH (High Resistance ThermoPlastic Resin) Shell&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Multi Density E.P.S. (inner shell)</span></li>\r\n<li><span style=\"font-size: small;\">IVS; Integrated Ventilation System, large vents and wide channels throughout the shell for maximum airflow and improved aerodynamic penetration&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Fully removable, washable microperforated Dry Comfort with Lycra &nbsp;lining with Sanitized antibacterial hygienic treatment&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">3D interior, one-piece moulded adjustable head lining&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">GT2 visor, Anti Scratch, Anti Fog, 100% UV protection&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">ISV Integrated Sun Visor</span></li>\r\n<li><span style=\"font-size: small;\">XQRS; Extra Quick Release System, visor changing in seconds with no tools (GT2+ISV)</span></li>\r\n<li><span style=\"font-size: small;\">PVM Personalized visor mechanism (interchangeable visor ratchet mechanism) (Race/Street/City)&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Low drag / Low lift aerodynamic shell&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Wind tunnel developed aeroacoustics</span></li>\r\n<li><span style=\"font-size: small;\">Reflective panels on neck-roll&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Locking chin bar</span></li>\r\n<li><span style=\"font-size: small;\">Dual homologation P&amp;J</span></li>\r\n<li><span style=\"font-size: small;\">Easy-lift one hand operation chin bar</span></li>\r\n<li><span style=\"font-size: small;\">Micrometric buckle retention system&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Removable chin curtain</span></li>\r\n<li><span style=\"font-size: small;\">Removable nose protector</span></li>\r\n</ul>\r\n<div><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><strong>Note:</strong></span></span><span style=\"font-size: small;\"><strong>&nbsp;</strong>Expected Release date is late December 2013&nbsp;: The Pre-Order Price does not reflect the price of the item, only the price of reservation.&nbsp;</span></div>', '0', 'sku', 'N', '299.95', '299.95', '0.00', 'Small', '', '', 'male', 'http://www.motochanic.com/agv-numo-hi-viz-helmet/', 'http://www.motochanic.com/product_images/p/650/agv_50267_1__16634.jpg', '', '', '0', '2014-09-02 19:46:32');
