y)&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Low drag / Low lift aerodynamic shell&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Wind tunnel developed aeroacoustics</span></li>\r\n<li><span style=\"font-size: small;\">Reflective panels on neck-roll&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Locking chin bar</span></li>\r\n<li><span style=\"font-size: small;\">Dual homologation P&amp;J</span></li>\r\n<li><span style=\"font-size: small;\">Easy-lift one hand operation chin bar</span></li>\r\n<li><span style=\"font-size: small;\">Micrometric buckle retention system&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Removable chin curtain</span></li>\r\n<li><span style=\"font-size: small;\">Removable nose protector</span></li>\r\n</ul>\r\n<div><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><strong>Note:</strong></span></span><span style=\"font-size: small;\"><strong>&nbsp;</strong>Expected Release date is late December 2013&nbsp;: The Pre-Order Price does not reflect the price of the item, only the price of reservation.&nbsp;</span></div>', '0', 'sku', 'N', '299.95', '299.95', '0.00', 'X-Large', '', '', 'male', 'http://www.motochanic.com/agv-numo-hi-viz-helmet/', 'http://www.motochanic.com/product_images/p/650/agv_50267_1__16634.jpg', '', '', '0', '2014-09-02 19:46:32');
INSERT INTO `datafeed` VALUES ('25992', '2553', 'AGV Helmets', 'AGV MT-X Karma Helmet', '0100-2856', '<p><a href=\"/agv-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p><p></p><p>The MT-X was the first step in restyling the new AGV Off-Road line, which boasts the AX-8 Evo as its top product today. Its design clearly recalls the typical contours of the latest items in the AGV range, with important features focusing on details, fit, ventilation and the quality/price ratio. The MT-X is the ideal helmet for those who want to approach the off-road world.</p><ul><li><strong>Shell:</strong>&nbsp;Painted HIR-TH (high resistant thermoplastic) resin</li><li><strong>Number of shells:</strong>&nbsp;1 shell size</li><li><strong>Ventilation System:</strong>&nbsp;IVS (Integrated Ventilation System) with wide channels hollowed directly in the shell</li><li><strong>Fabrics:</strong>&nbsp;Dry Comfort with hygienic treatment</li><li><strong>Inside padding:</strong>&nbsp;Removable and washable</li><li><strong>Retention System:</strong>&nbsp;Double D</li></ul><p></p><p></p>', '0', 'sku', 'N', '179.95', '179.95', '0.00', 'X-Large', '', '', 'male', 'http://www.motochanic.com/agv-mt-x-karma-helmet/', 'http://www.motochanic.com/product_images/e/055/bcc284437cd066b8776a954495a55d23__11206.jpg', '', '', '0', '2014-09-02 19:45:03');
INSERT INTO `datafeed` VALUES ('18319', '2061', 'Leatt', 'Leatt STX Road Neck Brace', '0100030101', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Leatt STX Road Neck Brace</strong></span></p> <p><span style=\"font-size: small;\">There are only two types or motorcycle riding equipment specifically designed to help save a rider&rsquo;s life in severe crashes. Your helmet and a neck brace. Using alternative load path technology&nbsp;<span data-scayt_word=\"Leatt\" data-scaytid=\"1\">Leatt</span>&reg;&rsquo;s&nbsp;<span data-scayt_word=\"STX\" data-scaytid=\"2\">STX</span>&nbsp;neck brace seamlessly integrates comfort, function and freedom of movement.</span><br /><span style=\"font-size: small;\">The&nbsp;<span data-scayt_word=\"LEATT\" data-scaytid=\"5\">LEATT</span>&nbsp;<span data-scayt_word=\"STX\" data-scaytid=\"3\">STX</span>&nbsp;is the perfect neck protection for an over the garment fit! Unlike the off-road&nbsp;<span data-scayt_word=\"GPX\" data-scaytid=\"8\">GPX</span>&nbsp;and the bicycle&nbsp;<span data-scayt_word=\"DBX\" data-scaytid=\"9\">DBX</span>&nbsp;neck brace which are designed for an on the body fit the&nbsp;<span data-scayt_word=\"STX\" data-scaytid=\"4\">STX</span>&nbsp;will be at its best over your riding gear!</span></p> <p><span style=\"font-size: small;\">Designed to work over your protectors, your leathers or any type of textile riding gear the&nbsp;<span data-scayt_word=\"STX\" data-scaytid=\"10\">STX</span>&nbsp;will give you maximum protection but yet very comfortable. Adventure street and touring motorcycle riders love this neck brace as well as speedway and flat track racers.</span></p> <p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Features</strong></span><span style=\"font-size: medium;\"><strong>:</strong></span></p> <ul> <li><span style=\"font-size: small;\">Optimized for over the riding gear fit!</span></li> <li><span style=\"font-size: small;\">No-tool size adjustment</span></li> <li><span style=\"font-size: small;\">Unique rear scapula wings designed to accommodate back armor or aerodynamic hump</span></li> <li><span style=\"font-size: small;\">Folding rear scapula wings allows for easy carrying/storage</span></li> <li><span style=\"font-size: small;\">Motor Cyclist Magazine says: &ldquo;So comfortable you soon forget you have it on.&rdquo;</span></li> <li><span style=\"font-size: small;\">Integrated padding accommodates movement for over-the-shoulder views.</span></li> <li><span style=\"font-size: small;\">Rubber-coated front tip helps prevent motorcycle body scratches.</span></li> <li><span style=\"font-size: small;\">Jacket zipper relief</span></li> <li><span style=\"font-size: small;\">Comes with optional strap system</span></li> <li><span style=\"font-size: small;\">Replacement parts available</span></li> <li><span style=\"font-size: small;\">Adjustable sizing to fit most riders</span></li> <li><span style=\"font-size: small;\">Available in size #S/M, #L/XL and #<span data-scayt_word=\"XXL\" data-scaytid=\"12\">XXL</span></span></li> <li><span style=\"font-size: small;\">Weighs only 740 grams/26 ounces!</span></li> </ul>', '20', 'sku', 'N', '399.00', '399.00', '0.00', 'Small/Medium', '', '', 'male', 'http://www.motochanic.com/leatt-stx-road-neck-brace/', 'http://www.motochanic.com/product_images/j/690/timthumb__69393.jpg', '', '', '0', '2014-09-02 19:44:30');
