signature edition of the&nbsp;<span data-scayt_word=\"STX\" data-scaytid=\"13\">STX</span>&nbsp;Road.</span></p> <p><strong><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\">Features</span></span><span style=\"font-size: medium;\">:</span></strong></p> <ul> <li><span style=\"font-size: small;\">Optimized for over the riding gear fit!</span></li> <li><span style=\"font-size: small;\">No-tool size adjustment</span></li> <li><span style=\"font-size: small;\">Unique rear scapula wings designed to accommodate back armor or aerodynamic hump</span></li> <li><span style=\"font-size: small;\">Folding rear scapula wings allows for easy carrying/storage</span></li> <li><span style=\"font-size: small;\">Motor Cyclist Magazine says: &ldquo;So comfortable you soon forget you have it on.&rdquo;</span></li> <li><span style=\"font-size: small;\">Integrated padding accommodates movement for over-the-shoulder views.</span></li> <li><span style=\"font-size: small;\">Rubber-coated front tip helps prevent motorcycle body scratches.</span></li> <li><span style=\"font-size: small;\">Jacket zipper relief</span></li> <li><span style=\"font-size: small;\">Comes with optional strap system</span></li> <li><span style=\"font-size: small;\">Replacement parts available</span></li> <li><span style=\"font-size: small;\">Adjustable sizing to fit most riders</span></li> <li><span style=\"font-size: small;\">Available in size #S/M, #L/XL and #<span data-scayt_word=\"XXL\" data-scaytid=\"16\">XXL</span></span></li> <li><span style=\"font-size: small;\">Weighs only 740 grams/26 ounces!</span></li> </ul> <p><span><br /></span></p>', '20', 'sku', 'N', '419.00', '419.00', '0.00', 'XX-Large', '', '', 'male', 'http://www.motochanic.com/leatt-stx-jason-britton-road-neck-brace/', 'http://www.motochanic.com/product_images/f/338/Image_Brace_STX_Jason_Britton_3__13710.jpg', '', '', '0', '2014-09-02 19:44:30');
INSERT INTO `datafeed` VALUES ('18310', '2056', 'Leatt', 'Leatt GPX Pro Neck Brace', '0100230200', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>The LEATT&reg; PRO neck brace is the pinnacle in neck brace technology! The PRO brace features a fully ventilated, carbon-fiber chassis with completely redesigned, open-cell padding. The PRO brace is the lightest, most ventilated and most comfortable brace we have ever designed and, like all LEATT-BRACES&reg;, is built around Alternative Load Path Technology&reg;(ALPT&reg;) to give you the confidence needed to compete at the top of your sport! - The lightest Leatt-Brace&reg; available 600g &plusmn; 50g (19oz &plusmn; 1.8oz)! - Kevlar reinforced carbon fiber matrix chassis - Anodized CNC spring-loaded aluminium hinges are easy to use for both left- and right-handers. Their bright red colour ensures easy identification by paramedical personnel in an emergency situation. - New open-celled, light weight, Velcro-free padding is removable &amp; washable. - Revolutionary vented padding and brace structure. - Engineered collarbone cutout to help keep your helmet and brace away from one of your most fragile bones. - Unique one-piece rear support (thoracic) designed to break away in severe impact scenarios. - The greatest range of motion of any Leatt-Brace&reg; - Comes with harness system with quick-release buckles. - On-board rear thoracic angle adjustment. - Adjustable sizing to fit riders according to LEATT&reg; size chart. - Replacement parts available - CE Approved</p>', '0', 'sku', 'N', '599.00', '599.00', '0.00', 'M', '', '', 'male', 'http://www.motochanic.com/leatt-gpx-pro-neck-brace/', 'http://www.motochanic.com/product_images/k/562/image_brace_pro_black_grey_2__88294.jpg', '', '', '0', '2014-09-02 19:44:30');
INSERT INTO `datafeed` VALUES ('18309', '2056', 'Leatt', 'Leatt GPX Pro Neck Brace', '0100230202', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>The LEATT&reg; PRO neck brace is the pinnacle in neck brace technology! The PRO brace features a fully ventilated, carbon-fiber chassis with completely redesigned, open-cell padding. The PRO brace is the lightest, most ventilated and most comfortable brace we have ever designed and, like all LEATT-BRACES&reg;, is built around Alternative Load Path Technology&reg;(ALPT&reg;) to give you the confidence needed to compete at the top of your sport! - The lightest Leatt-Brace&reg; available 600g &plusmn; 50g (19oz &plusmn; 1.8oz)! - Kevlar reinforced carbon fiber matrix chassis - Anodized CNC spring-loaded aluminium hinges are easy to use for both left- and right-handers. Their bright red colour ensures easy identification by paramedical personnel in an emergency situation. - New open-celled, light weight, Velcro-free padding is removable &amp; washable. - Revolutionary vented padding and brace structure. - Engineered collarbone cutout to help keep your helmet and brace away from one of your most fragile bones. - Unique one-piece rear support (thoracic) designed to break away in severe impact scenarios. - The greatest range of motion of any Leatt-Brace&reg; - Comes with harness system with quick-release buckles. - On-board rear thoracic angle adjustment. - Adjustable sizing to fit riders according to LEATT&reg; size chart. - Replacement parts available - CE Approved</p>', '20', 'sku', 'N', '599.00', '599.00', '0.00', 'S', '', '', 'male', 'http://www.motochanic.com/leatt-gpx-pro-neck-brace/', 'http://www.motochanic.com/product_images/k/562/image_brace_pro_black_grey_2__88294.jpg', '', '', '0', '2014-09-02 19:44:30');
INSERT INTO `datafeed` VALUES ('18315', '2057', 'Leatt', 'Leatt GPX Club III Neck Brace', '0100330070', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>The Club III is the next evolution of the most popular motosports neck brace in the world. The Club III chassis is now constructed of new LEATT&reg; High Impact Polymer (LHIP) which improves its durability in a greater range of temperatures. The 5-way adjustability allows for a wide range of body shapes and body sizes, creating a better, more comfortable fit than any other neck brace. The adjustable height of the front and rear tables, a Club brace exclusive feature, provides a better helmet-to-brace interface for more body shapes and neck lengths. As with all Leatt&reg; neck braces, the Club III is designed by a medical doctor with the help of biomedical engineers and medical professionals. - New proprietary chassis material &ndash; LHIP (Leatt High Impact Polymer) - New, lighter weight, clip-on padding made of Crosslink - New wider, reshaped rear Thoracic strut - New tougher, more foolproof hinge system - New more comfortable chest strap system - Worn and trusted by more riders than all other neck braces combined - As always the Club III features: &bull; Alternative Load Path Technology&trade; &bull; 5-way adjustability, making it the best-fitting brace in the world &bull; a collarbone relief section &bull; a break-away rear strut and crush zones for enhanced safety - Two side hinges are simple to use for both right and left handed riders and bright red color helps identify them to track workers or paramedics - Padding kit removable/washable - Replacement parts available. - CE Approved to Personal Protective Equipment directive 89/686/eec</p>', '0', 'sku', 'N', '399.00', '399.00', '0.00', 'S', 'White', '', 'male', 'http://www.motochanic.com/leatt-gpx-club-iii-neck-brace/', 'http://www.motochanic.com/product_images/d/042/gpx_club_3_white_3_lores__38937.jpg', '', '', '0', '2014-09-02 19:44:30');
