INSERT INTO `datafeed` VALUES ('18312', '2057', 'Leatt', 'Leatt GPX Club III Neck Brace', '0100330101', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>The Club III is the next evolution of the most popular motosports neck brace in the world. The Club III chassis is now constructed of new LEATT&reg; High Impact Polymer (LHIP) which improves its durability in a greater range of temperatures. The 5-way adjustability allows for a wide range of body shapes and body sizes, creating a better, more comfortable fit than any other neck brace. The adjustable height of the front and rear tables, a Club brace exclusive feature, provides a better helmet-to-brace interface for more body shapes and neck lengths. As with all Leatt&reg; neck braces, the Club III is designed by a medical doctor with the help of biomedical engineers and medical professionals. - New proprietary chassis material &ndash; LHIP (Leatt High Impact Polymer) - New, lighter weight, clip-on padding made of Crosslink - New wider, reshaped rear Thoracic strut - New tougher, more foolproof hinge system - New more comfortable chest strap system - Worn and trusted by more riders than all other neck braces combined - As always the Club III features: &bull; Alternative Load Path Technology&trade; &bull; 5-way adjustability, making it the best-fitting brace in the world &bull; a collarbone relief section &bull; a break-away rear strut and crush zones for enhanced safety - Two side hinges are simple to use for both right and left handed riders and bright red color helps identify them to track workers or paramedics - Padding kit removable/washable - Replacement parts available. - CE Approved to Personal Protective Equipment directive 89/686/eec</p>', '0', 'sku', 'N', '399.00', '399.00', '0.00', 'M', 'Blue', '', 'male', 'http://www.motochanic.com/leatt-gpx-club-iii-neck-brace/', 'http://www.motochanic.com/product_images/d/042/gpx_club_3_white_3_lores__38937.jpg', '', '', '0', '2014-09-02 19:44:30');
INSERT INTO `datafeed` VALUES ('18317', '2057', 'Leatt', 'Leatt GPX Club III Neck Brace', '0100330110', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>The Club III is the next evolution of the most popular motosports neck brace in the world. The Club III chassis is now constructed of new LEATT&reg; High Impact Polymer (LHIP) which improves its durability in a greater range of temperatures. The 5-way adjustability allows for a wide range of body shapes and body sizes, creating a better, more comfortable fit than any other neck brace. The adjustable height of the front and rear tables, a Club brace exclusive feature, provides a better helmet-to-brace interface for more body shapes and neck lengths. As with all Leatt&reg; neck braces, the Club III is designed by a medical doctor with the help of biomedical engineers and medical professionals. - New proprietary chassis material &ndash; LHIP (Leatt High Impact Polymer) - New, lighter weight, clip-on padding made of Crosslink - New wider, reshaped rear Thoracic strut - New tougher, more foolproof hinge system - New more comfortable chest strap system - Worn and trusted by more riders than all other neck braces combined - As always the Club III features: &bull; Alternative Load Path Technology&trade; &bull; 5-way adjustability, making it the best-fitting brace in the world &bull; a collarbone relief section &bull; a break-away rear strut and crush zones for enhanced safety - Two side hinges are simple to use for both right and left handed riders and bright red color helps identify them to track workers or paramedics - Padding kit removable/washable - Replacement parts available. - CE Approved to Personal Protective Equipment directive 89/686/eec</p>', '0', 'sku', 'N', '399.00', '399.00', '0.00', 'S', 'Red', '', 'male', 'http://www.motochanic.com/leatt-gpx-club-iii-neck-brace/', 'http://www.motochanic.com/product_images/d/042/gpx_club_3_white_3_lores__38937.jpg', '', '', '0', '2014-09-02 19:44:30');
INSERT INTO `datafeed` VALUES ('18318', '2057', 'Leatt', 'Leatt GPX Club III Neck Brace', '0100330111', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>The Club III is the next evolution of the most popular motosports neck brace in the world. The Club III chassis is now constructed of new LEATT&reg; High Impact Polymer (LHIP) which improves its durability in a greater range of temperatures. The 5-way adjustability allows for a wide range of body shapes and body sizes, creating a better, more comfortable fit than any other neck brace. The adjustable height of the front and rear tables, a Club brace exclusive feature, provides a better helmet-to-brace interface for more body shapes and neck lengths. As with all Leatt&reg; neck braces, the Club III is designed by a medical doctor with the help of biomedical engineers and medical professionals. - New proprietary chassis material &ndash; LHIP (Leatt High Impact Polymer) - New, lighter weight, clip-on padding made of Crosslink - New wider, reshaped rear Thoracic strut - New tougher, more foolproof hinge system - New more comfortable chest strap system - Worn and trusted by more riders than all other neck braces combined - As always the Club III features: &bull; Alternative Load Path Technology&trade; &bull; 5-way adjustability, making it the best-fitting brace in the world &bull; a collarbone relief section &bull; a break-away rear strut and crush zones for enhanced safety - Two side hinges are simple to use for both right and left handed riders and bright red color helps identify them to track workers or paramedics - Padding kit removable/washable - Replacement parts available. - CE Approved to Personal Protective Equipment directive 89/686/eec</p>', '0', 'sku', 'N', '399.00', '399.00', '0.00', 'M', 'Red', '', 'male', 'http://www.motochanic.com/leatt-gpx-club-iii-neck-brace/', 'http://www.motochanic.com/pro