INSERT INTO `datafeed` VALUES ('18325', '2063', 'Leatt', 'Leatt SNX Pilot Neck Brace', '0100950001', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/leatt-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>Based on the award-winning original, the SNX PILOT is Leatt&reg;&rsquo;s first brace specifically for Snowmobile riding and racing. Fully adjustable for individual rider fit and comfort, the SNX PILOT is constructed from Leatt&rsquo;s own Arctic Fusion Compound&trade;, a special blend able to withstand extreme low temperatures. The exclusive clip-on padding is constructed from low-temperature impact foam that resists snow sticking to it, for optimal function in snow conditions. As with all Leatt-braces&reg;, the SNX PILOT is built around Leatt&reg;&rsquo;s patented Alternative Load Path Technology&reg;, which helps protect a rider during a crash by directing impact energy away from the neck onto less vulnerable parts of the body.* ALPT&reg; is a key feature of all Leatt-braces&reg;. The SNX PILOT also comes with a waterproof &amp; breathable brace sock that stretches over the brace and increases comfort by keeping out the harsh winter elements. Other key features: Arctic Fusion Compound&trade; (AFC&trade;) &ndash; a special blend to withstand extreme cold conditions Exclusive SNX clip-on padding resists snow sticking to it Legendary Alternative Load Path Technology&reg; (ALPT&reg;) Brace sock &ndash; waterproof &amp; breathable barrier against winter elements, for rider comfort. Fully adjustable upper tables (front &amp; rear) Approximate weight: (lighter) 790g &plusmn; 50g (26oz &plusmn; 1.8oz)</p>', '20', 'sku', 'N', '429.99', '429.99', '0.00', 'S', '', '', 'male', 'http://www.motochanic.com/leatt-snx-pilot-neck-brace/', 'http://www.motochanic.com/product_images/a/947/file_6_7_1__90653.jpg', '', '', '0', '2014-09-02 19:44:30');
