INSERT INTO `datafeed` VALUES ('5703', '737', 'AGV Helmets', 'AGV GP-Tech Helmet', '0101-2730', '<p><a href=\"/agv-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p><p>2-piece dual-density carbon Kevlar&reg; construction. Ventilated by the IVS (Integrated Ventilation System) which features channels hollowed directly into the shell of the helmet. Features a fully removable and washable CoolMax liner. Comes with an anti-fog and anti-scratch polycarbonate clear Racer-X visor with tear-off system. Replace the shield within seconds without the use of tools. Double D-ring chin strap. DOT and ECE-2205 certified.</p>', '0', 'sku', 'N', '599.95', '599.95', '0.00', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/agv-gp-tech-helmet/', 'http://www.motochanic.com/product_images/e/346/1014274__35307.jpg', '', '', '0', '2014-09-02 19:46:41');
