INSERT INTO `datafeed` VALUES ('5773', '743', 'AGV Helmets', 'AGV K3 Helmet', '0101-3535', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/agv-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>\n<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>AGV K3 Helmet</strong></span></p>\n<p><span style=\"font-size: small;\">The AGV K3 is among the most popluar Helmets of the AGV helmet line up. This helmet comes in varity of graphics and is a favorite among new and experienced riders for its style and reliable construction using a thermoplastic shell. The AGV K3 features ventilation on the front chin, side air vents with a top air vent with exhausting. This helmet includes a brand new visor mechanism with an anti-fog and scratch resistant visor. The K3 has a removable breath guard, comfort padding with dri-lex fabric and is DOT certified.&nbsp;</span></p>', '3', 'sku', 'N', '169.95', '169.95', '0.00', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/agv-k3-helmet/', 'http://www.motochanic.com/product_images/a/943/1013535__48967.jpg', '', '', '0', '2014-09-02 19:46:44');
