INSERT INTO `datafeed` VALUES ('8393', '952', 'Icon', 'Icon Airframe Helmet', '0101-4089', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>Carbon fiber and Dyneema&Icirc;&Acirc; composite shell for extra strength. Lifeform has an advanced all carbon-fiber shell. Oversized intake and exhaust ports vent hot air and help prevent fogging. Removable molded breath deflector reduces shield fogging. Quick-change fog-free eye Proshield&aring;_?&cent;. Prolock&aring;_?&cent; secure shield locking system. Rear spoiler for reduced helmet buffeting. Fully removable Hydra-Dry&aring;_?&cent; moisture-wicking interior. Rubatone is a matte-finish rubberized paint developed to match your riding gear. Construct has a naked amber weave finish that has been coated in rich gloss coat. Lifeform Carbon, Lifeform, Medallion, Sacrifice, Street Angel, Rubatone black and Claymore Chrome are AWS-certified; Claymore and Burn Baby Burn are DOT and Snell certified; Solids, Death or Glory and Crossbones Racer may come in either SNELL/DOT or AWS-certified. All World Standard meets or exceeds the following: DOT FMVSS 218 (USA), ECE 22-05 (Europe), SAI AS1698 (Australia), &amp; SG (Japan) safety and testing standards; does not ship with SAI or SG certification stickers unless purchased from an authorized dealer in that country.</p>', '2', 'sku', 'N', '265.00', '265.00', '0.00', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/icon-airframe-helmet/', 'http://www.motochanic.com/product_images/q/245/AirframeBlackGlossFront__14178.jpg', '', '', '0', '2014-09-02 19:47:16');
