INSERT INTO `datafeed` VALUES ('5833', '747', 'AGV Helmets', 'AGV T2 Rep Agostini Helmet', '0101-4226', '<p><a href=\"/agv-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p><p>Three shell sizes in SSL (fiberglass, Kevlar&reg;, carbon) with double-density EPS in four sizes. Features an integrated ventilation system with wide channels hollowed directly into the shell. Enhances airflow into the helmet for improved aerodynamic penetration. Includes three front air intakes and four rear extractors for great ventilation. Extra Quick Release System (XQRS) so you can replace the shield in seconds without the use of tools. A safety device designed to avoid visor detachment in case of a fall is also included. Uses a Race-x anti-scratch, anti-fog visor with tear-off posts. Detachable nose protector and wind-protector for your chin. Removable and washable CoolMax&reg; and Dry-Comfort&reg; inside padding, including the neckroll. Double-D retention system. DOT and ECE 22-05 certified.</p>', '0', 'sku', 'N', '549.95', '549.95', '415.95', 'Small', '', '', 'male', 'http://www.motochanic.com/agv-t2-rep-agostini-helmet/', 'http://www.motochanic.com/product_images/b/547/1014225A__42799.jpg', '', '', '0', '2014-09-02 19:46:48');
