INSERT INTO `datafeed` VALUES ('8421', '954', 'Icon', 'Icon Airframe Carbon Lifeform Helmet', '0101-4559', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>Carbon - the fundamental structure of all life - incredibly light, unbelievably strong. We\'ve used this fundamental element to produce our lightest helmet ever. The shell is formed with Icon\'s unique dry molding technology which allows for exact placement of carbon material. This controlled placement provides reinforced structure without adding weight. Indeed, weighing in at a mere 1450 grams, the Carbon lifeform is a prime example of the most modern of helmet manufacturing technologies. Of course the weight savings benefit is matched by the vastly superior venting system used in the Airframe. Where the other manufacturers imply venting the Airframe truly delivers. If you have the means we highly recommend acquiring this truly unique Airframe. You will not be disappointed. All world standard, Meets of exceeds the following: DOT FMVSS 218 (US), ECE 22-05 (Europe), SAI AS1698 (Australia) &amp; SG (Japan) safety and testing standards. Does not ship with SAI or SG certification stickers unless purchased in that country. Carbon fiber shell. 1450 grams in size medium (+/-50 grams). Wind tunnel tested and refined. Multiple oversized intake and exhaust ports. Click to view the Helmet Care Video. Removable molded breath deflector reduces shield fogging. Quick-change fog-free proshield with sideplates. Fully removable/washable hydradry interior. Rear spoiler for reduced helmet buffeting. Prolock secure shield locking system. Removable chin curtain.</p>', '0', 'sku', 'N', '515.00', '515.00', '0.00', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/icon-airframe-carbon-lifeform-helmet/', 'http://www.motochanic.com/product_images/z/069/AirframeLifeformCarbonWhiteFront-sRGB__38217.jpg', '', '', '0', '2014-09-02 19:47:16');
INSERT INTO `datafeed` VALUES ('8422', '954', 'Icon', 'Icon Airframe Carbon Lifeform Helmet', '0101-4560', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>Carbon - the fundamental structure of all life - incredibly light, unbelievably strong. We\'ve used this fundamental element to produce our lightest helmet ever. The shell is formed with Icon\'s unique dry molding technology which allows for exact placement of carbon material. This controlled placement provides reinforced structure without adding weight. Indeed, weighing in at a mere 1450 grams, the Carbon lifeform is a prime example of the most modern of helmet manufacturing technologies. Of course the weight savings benefit is matched by the vastly superior venting system used in the Airframe. Where the other manufacturers imply venting the Airframe truly delivers. If you have the means we highly recommend acquiring this truly unique Airframe. You will not be disappointed. All world standard, Meets of exceeds the following: DOT FMVSS 218 (US), ECE 22-05 (Europe), SAI AS1698 (Australia) &amp; SG (Japan) safety and testing standards. Does not ship with SAI or SG certification stickers unless purchased in that country. Carbon fiber shell. 1450 grams in size medium (+/-50 grams). Wind tunnel tested and refined. Multiple oversized intake and exhaust ports. Click to view the Helmet Care Video. Removable molded breath deflector reduces shield fogging. Quick-change fog-free proshield with sideplates. Fully removable/washable hydradry interior. Rear spoiler for reduced helmet buffeting. Prolock secure shield locking system. Removable chin curtain.</p>', '0', 'sku', 'N', '515.00', '515.00', '0.00', 'Small', 'Black', '', 'male', 'http://www.motochanic.com/icon-airframe-carbon-lifeform-helmet/', 'http://www.motochanic.com/product_images/z/069/AirframeLifeformCarbonWhiteFront-sRGB__38217.jpg', '', '', '0', '2014-09-02 19:47:16');
