INSERT INTO `datafeed` VALUES ('8439', '956', 'Icon', 'Icon Airframe Street Angel Helmet', '0101-4580', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p> <p>If you\'ve got an Angel, your a lucky man - keep her off the streets. But if you\'ve got a Street Angel there won\'t be any stopping her. Your only choice is to put her in gear tough enough to survive the asphalt battlefield. This starts with a premier lid - the Airframe Street Angel. Engineered to meet the toughest safety standards and graphic\'d enough to meet hers. Unquestionably feminine but accented with a hardened core. Kind of like a beauty queen packing a straight razor-easy on the eyes, but best keep you hands to yourself. All world standard, meets or exceeds the following: DOT FMVSS 218(US), ECE 22-05 (EUROPE), SAI AS1698(AUSTRALIA) &amp; SG (JAPAN) safety and testing standards. Does not ship with SAI or SG certification stickers unless purchased in that country. Fiberglass/Dyneema/Carbon fiber shell. Wind tunnel tested and refined. Multiple oversized intake and exhaust ports. Click to view the Helmet Care Video. Removable molded breath deflector reduces shield fogging. Quick-change fog-free proshield with sideplates. Fully removable/washable hydradry interior. Rear spoiler for reduced helmet buffeting. Prolock secure shield locking system. Removable chin curtain.</p>', '0', 'sku', 'N', '330.00', '330.00', '0.00', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/icon-airframe-street-angel-helmet/', 'http://www.motochanic.com/product_images/o/582/AirframeStreetAngelPinkFront-sRGB__25332.jpg', '', '', '0', '2014-09-02 19:47:16');
