INSERT INTO `datafeed` VALUES ('8505', '960', 'Icon', 'Icon Airframe Construct Helmet', '0101-4903', '<p><a href=\"/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>  <p>Some would have you believe beauty is only skin deep - the Airframe Construct begs to differ. With it\'s naked amber weave, drenched in a rich gloss coat, the Construct unabashedly flaunts it\'s form - an engineered matrix of Fiberglass, Dyneema and Carbon Fiber. Though already bordering on visual perfection, the Construct ships with an additional dark smoke Proshield to further enhance it\'s allure. All new, all natural and all Airframe. All world standard, meets or exceeds the following: DOT FMVSS 218(US), ECE 22-05(EUROPE), SAI AS1698(AUSTRALIA) &amp; SG(JAPAN) safety and testing standards. Does not ship with SAI or SG certification stickers unless purchased in that country. Special \'Naked\' Finish Fiberglass/Dyneema/Carbon fiber shell. Wind tunnel tested and refined. Multiple oversized intake and exhaust ports. Removable molded breath deflector reduces shield fogging. Quick-change fog-free proshield with sideplates. Fully removable/washable hydradry interior. Rear spoiler for reduced helmet buffeting. Prolock secure shield locking system. Removable chin curtain.</p>', '10', 'sku', 'N', '295.00', '295.00', '0.00', 'Small', '', '', 'male', 'http://www.motochanic.com/icon-airframe-construct-helmet/', 'http://www.motochanic.com/product_images/p/315/AirframeConstructFront__41154.jpg', '', '', '0', '2014-09-02 19:47:17');
