INSERT INTO `datafeed` VALUES ('8558', '964', 'Icon', 'Icon Alliance Rubatone Helmet', '0101-4957', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>\r\n<p>All world standard, meets or exceeds the following: DOT FMVSS 218 (US), ECE 22-05 (EUROPE), SAI AS1698 (AUSTRALIA) &amp; SG (JAPAN) safety and testing standards. Does not ship with SAI OR SG Certification stickers unless purchased from an authorized dealer in that country. Injection molded polycarbonate shell for strength. Long oval headform. Wind tunnel tested and refined. Molded twin channel supervent for increased/cooling. Rear exhaust ports prevent heat buildup. Removable molded breath deflector reduces shield fogging. Chin venting system reduces shield fogging. Fully removable/washable Hydradry interior. Quick-change fog-free Proshield with sideplates. Prolock shield locking system.</p>', '0', 'sku', 'N', '170.00', '170.00', '109.00', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/icon-alliance-rubatone-helmet/', 'http://www.motochanic.com/product_images/g/186/AllianceRubtoneBlackBack__32155.jpg', '', '', '0', '2014-09-02 19:47:17');
