INSERT INTO `datafeed` VALUES ('8565', '965', 'Icon', 'Icon Alliance HI-VIZ Helmet', '0101-4964', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>\r\n<p>When it comes to motorcycle safety - we believe the best possible protection is avoiding the crash altogether. Such was the reasoning behind the Alliance Hi-Viz helmet. Painted in a UV-resistant fluorescent color and affixed with reflective graphics, the Hi-Viz will dramatically increase your day or night conspicuity. See and be seen. All World Standard, meets or exeeds the folowing:DOT FMVSS 218 (US), ECE 22-05 (Europe), SAI AS1698 (Australia) &amp; SG (Japan)Safety and testing standards. Does not ship with SAI or SG Certification stickers unless Purchased from an authorized dealer in that country.. Reflective Graphics. Injection molded polycarbonate shell for strength. Long oval headform. Wind tunnel tested and refined. Molded twin channel supervent for increased cooling. Rear Exhaust ports prevent heat buildup. Removable molded breath deflector reduces shield fogging. Chin venting system reduces shield fogging. Fully removable/washable HydraDryTM interior. Quick-change fog-free eye ProshieldTM. ProLockTM secure shield locking system.</p>', '8', 'sku', 'N', '220.00', '220.00', '0.00', 'X-Small', 'Yellow', '', 'male', 'http://www.motochanic.com/icon-alliance-hi-viz-helmet/', 'http://www.motochanic.com/product_images/g/329/AllianceHiVizYellowFront__38848.jpg', '', '', '0', '2014-09-02 19:47:17');
