INSERT INTO `datafeed` VALUES ('8645', '970', 'Icon', 'Icon Alliance Lucky Lid Helmet', '0101-5411', '<p><a href=\"/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>  <p>You guys should make a helmet with a giant roulette wheel on it. We\'ve heard the suggestion about 1000 times. Hmmm... goes our usual reply as our eyes roll backwards. It just kinda seems like that has been done to death. And then a stroke of brilliance hits. Wait a tick, thats it! Death! We\'ll add a Suicide King to one side and a Grim Reaper to the other! Genius! With the age old question of how to freshly execute tired Vegas themed graphics solved, we immediately set to work on the Lucky Lid. The only thing left to do was to craft some cliche laden product copy about gambling. All World Standard, meets or exceeds the following: DOT FMVSS 218 (US), ECE 22-05 (Europe), SAI AS1698 (Australia) &amp; SG (Japan) safety and testing standards. Does not ship with SAI or SG certification stickers unless purchesed from an authorized dealer in that country. Injection molded polycarbonate shell for strength. Long oval headform. Wind tunnel tested and refined. Molded twin channel supervent for increased cooling. Rear exhaust ports prevent heat buildup. Removable molded breath deflector reduces shield fogging. Chin venting system reduces shield fogging. Fully reemovable/washable Hydradry interior. Quick-change fog-free proshield with sideplates. Prolock shield locking system.</p>', '0', 'sku', 'N', '200.00', '200.00', '0.00', 'X-Small', '', '', 'male', 'http://www.motochanic.com/icon-lucky-lid-helmet/', 'http://www.motochanic.com/product_images/w/667/Icon_Alliance_Lucky_Lid_detail-1__76725.jpg', '', '', '0', '2014-09-02 19:47:17');
