INSERT INTO `datafeed` VALUES ('8678', '972', 'Icon', 'Icon Alliance Freaky Tiki Helmet', '0101-5449', '<p><a href=\"/icon-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p><p>In this new exciting age of computers and software virtually anybody can be an artist. Want to put a cat on a planet? No problem. Want to put Buscemis eyes on a hot chick? Done. Yet in spite of this new limitless realm of artistic possibilities we went old school. We went Uga-chuka Uga-chuka old school. Hand-drawn and colored with the inks of Polynesia, we\'ve unleashed a Tiki terror on the highways of America. You\'ve been warned! All World Standard, meets or exceeds the following: DOT FMVSS 218 (US), ECE 22-05 (Europe), SAI AS1698 (Australia) &amp; SG (Japan) safety and testing standards. Does not ship with SAI or SG certification stickers unless purchesed from an authorized dealer in that country, Injection molded polycarbonate shell for strength, Long oval headform, Wind tunnel tested and refined, Molded twin channel supervent for increased cooling, Rear exhaust ports prevent heat buildup, Removable molded breath deflector reduces shield fogging, Chin venting system reduces shield fogging, Fully reemovable/washable Hydradry interior, Quick-change fog-free proshield with sideplates, Prolock shield locking system.</p>', '0', 'sku', 'N', '210.00', '210.00', '119.95', 'X-Small', 'Black', '', 'male', 'http://www.motochanic.com/icon-alliance-freaky-tiki-helmet/', 'http://www.motochanic.com/product_images/v/194/Icon_Alliance_Freaky_Tiki_detail-1__94677.jpg', '', '', '0', '2014-09-02 19:47:17');
