INSERT INTO `datafeed` VALUES ('38598', '3972', 'Olympia', 'Olympia Women\'s Airglide 4 Jacket', 'WJ212P-XS', '<p><a href=\"/olympia-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\"></a></p><p>Heat, wind, rain and cold areno match for our ladies Airglide 4 jacket. Constructed in authentic Cordura&reg; fabric with ballistic nylon mesh panels, this style offers maximum airflow with superior abrasion resistance. Its also been designed with a women&rsquo;s specific fit and flattering hour glass shape. For added safety, this jacket offers 3M Scotchlite&reg; piping at the chest, back and sleeves. Equipped with a sporty, two stage wind and waterproof Thermolite&reg; insulated liner jacket, our ladies Airglide 4 delivers the ultimate in all weather, multi season riding comfort.</p>', '9', 'sku', 'N', '289.99', '289.99', '0.00', 'X-Small', 'Pewter/Black', '', 'female', 'http://www.motochanic.com/olympia-womens-airglide-4-jacket/', 'http://www.motochanic.com/product_images/w/351/WJ212_Liner_Open__80849.JPG', '', '', '0', '2014-09-02 19:45:33');
