INSERT INTO `datafeed` VALUES ('60165', '6430', 'Olympia', 'Olympia Women\'s Ranger Jacket', 'WJ220G-2XL', '<p><a href=\"%%GLOBAL_ShopPathSSL%%/olympia-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\" /></a></p>\r\n<h1>Olympia Women\'s Ranger Jacket</h1>\r\n<p>Olympia&rsquo;s women&rsquo;s Ranger jacket functions year round in all weather conditions and offers unmatched levels of venting to deliver multi season riding comfort. Plenty of waterproof breathable jackets claim to function in a wide range of temperatures but their lack of adequate venting limits their use to cooler riding conditions. For warm weather rides, Olympia&rsquo;s women s Ranger jacket offers their exclusive AVS shoulder to forearm and torso venting system. This system offers special water tight zippers that when open; create major air flow directly to a riders body. Also equipped with Olympia&rsquo;s<strong> &ldquo;Two Layer System Design&rdquo;</strong> this jacket offers the ultimate in multi season riding comfort.</p>\r\n<h2><strong>Layer One of the Olympia Women\'s Ranger Jacket</strong></h2>\r\n<p>Wet and stormy rides are no match for Ranger s coated Cordura&reg; shell and waterproof breathable seam sealed membrane. For added protection from the elements, it also includes four zippered waterproof pockets and an oversized zippered waterproof back storage pocket. This jacket also offers a &nbsp;women&rsquo;s specific fit and flattering hour glass shape.</p>\r\n<h2><strong>Layer Two<strong>&nbsp;of the Olympia Women\'s Ranger Jacket</strong></strong></h2>\r\n<p>For maximum comfort during cold weather rides this jacket is also equipped with a stylish soft shell Thermolite&reg; insulated liner jacket.</p>\r\n<h2><strong>Soft shell insulated liner jacket</strong></h2>\r\n<p>Sturdy wind and water resistant / &reg;breathable stretch nylon soft shell with Thermolite&reg;&nbsp; insulation, mandarin style knit trim collar, two zipper&nbsp; pockets and oversized interior stash pocket.</p>\r\n<h2><strong>AVS Venting System</strong></h2>\r\n<p>Fold up chest pocket flaps and velcro lock down torso straps hold chest zipper vents open to create adjustable air flow. Shoulder to forearm venting plus vertical back vents with fold back vent covers create maximum airflow and offer protection from the elements when you need it.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Stretch knit hood with rubberized Aqua Barrier and neck gator concealed under the collar</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Outer shell constructed in coated 500 and 2000 denier&nbsp; Cordura&reg; fabric&nbsp;&nbsp;</li>\r\n<li>Waterproof breathable membrane adds double waterproof protection&nbsp;&nbsp;</li>\r\n<li>Thermolite&reg; insulated soft shell liner jacket&nbsp;&nbsp;</li>\r\n<li>Airflow Ventilation System at chest arms and back&nbsp;&nbsp;</li>\r\n<li>Velcro lock down torso straps at chest pocket vents create&nbsp; adjustable air flow&nbsp;&nbsp;</li>\r\n<li>Double storm placket front closure&nbsp;&nbsp;&nbsp;</li>\r\n<li>Removable CE Motion Flex armor at&nbsp; elbows and shoulders&nbsp;</li>\r\n<li>Removable CE approved Motion&nbsp; Flex&nbsp; articulated back&nbsp;&nbsp; protector</li>\r\n<li>Cool mesh airflow lining&nbsp;</li>\r\n<li>Custom Fit detailing at collar, cuffs, elbows and waist&nbsp;</li>\r\n<li>Full circumference neoprene collar insert</li>\r\n<li>3M Scotchlite&reg; reflective piping at front, sides and back&nbsp;&nbsp;&nbsp;</li>\r\n<li>Thermo Weld reflective detail at side arms</li>\r\n<li>Five zippered waterproof storage pockets plus a large zippered waterproof rear storage pocket</li>\r\n</ul>', '9', 'sku', 'N', '369.99', '369.99', '0.00', '', 'Celebrity/White/ Black', '', 'female', 'http://www.motochanic.com/olympia-womens-ranger-jacket/', 'http://www.motochanic.com/product_images/i/080/WJ220U_flat__52998.jpg', '', '', '0', '2014-09-02 19:46:55');
