ts and oversized interior stash pocket.</p>\r\n<h2><strong>AVS Venting System</strong></h2>\r\n<p>Fold up chest pocket flaps and velcro lock down torso straps hold chest zipper vents open to create adjustable air flow. Shoulder to forearm venting plus vertical back vents with fold back vent covers create maximum airflow and offer protection from the elements when you need it.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Stretch knit hood with rubberized Aqua Barrier and neck gator concealed under the collar</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Outer shell constructed in coated 500 and 2000 denier&nbsp; Cordura&reg; fabric&nbsp;&nbsp;</li>\r\n<li>Waterproof breathable membrane adds double waterproof protection&nbsp;&nbsp;</li>\r\n<li>Thermolite&reg; insulated soft shell liner jacket&nbsp;&nbsp;</li>\r\n<li>Airflow Ventilation System at chest arms and back&nbsp;&nbsp;</li>\r\n<li>Velcro lock down torso straps at chest pocket vents create&nbsp; adjustable air flow&nbsp;&nbsp;</li>\r\n<li>Double storm placket front closure&nbsp;&nbsp;&nbsp;</li>\r\n<li>Removable CE Motion Flex armor at&nbsp; elbows and shoulders&nbsp;</li>\r\n<li>Removable CE approved Motion&nbsp; Flex&nbsp; articulated back&nbsp;&nbsp; protector</li>\r\n<li>Cool mesh airflow lining&nbsp;</li>\r\n<li>Custom Fit detailing at collar, cuffs, elbows and waist&nbsp;</li>\r\n<li>Full circumference neoprene collar insert</li>\r\n<li>3M Scotchlite&reg; reflective piping at front, sides and back&nbsp;&nbsp;&nbsp;</li>\r\n<li>Thermo Weld reflective detail at side arms</li>\r\n<li>Five zippered waterproof storage pockets plus a large zippered waterproof rear storage pocket</li>\r\n</ul>', '9', 'sku', 'N', '369.99', '369.99', '0.00', '', 'Celebrity/White/ Black', '', 'female', 'http://www.motochanic.com/olympia-womens-ranger-jacket/', 'http://www.motochanic.com/product_images/i/080/WJ220U_flat__52998.jpg', '', '', '0', '2014-09-02 19:46:55');
INSERT INTO `datafeed` VALUES ('27337', '2652', 'Olympia', 'Olympia Women\'s Airglide 3 Over Pants', 'WP154B-10', '<p><a href=\"/olympia-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\"></a></p><p>Designed to coordinate with our ladies Airglide and Switchback jacket, this style can be worn as a stand alone riding pant or as a full over pant. Constructed in authentic Cordura&reg; fabric with ballistic nylon mesh panels, they offer maximum airflow with superior abrasion resistance. Standing, boot on entry is a snap as side leg zippers extend all the way to the waistband. Two front zipper pockets and two rear snap pockets offer extra storage for personal items. Foul weather rides are never a problem as this style is also equipped with a wind and waterproof liner that can be worn as a wearable stand alone pant. Adjustable knee armor positions, stretch waist and hip panels plus EZ hem bottom detailing allows riders to achieve a customised fit.</p><ul><li class=\"no-bullet\">Outer shell constructed in 500 denier Cordura&reg; fabric with Ballistic Airflow mesh panels</li><li>Waterproof liner pant</li><li>Full side leg zippers extend to waistband</li><li>Removable and adjustable height CE Motion Flex armor at knees</li><li>Cool mesh airflow lining</li><li>Removable EVA compression foam at hips</li><li>Custom Fit detailing at waist, hips and bottom hem</li><li>3M Scotchlite&reg; reflective piping from waist to hem</li><li>Relaxed tailored fit</li><li>Four storage pockets</li><li>8&rdquo; connecting zipper for jackets</li></ul>', '9', 'sku', 'N', '229.99', '229.99', '0.00', '10', 'Black', '', 'female', 'http://www.motochanic.com/olympia-womens-airglide-3-over-pants/', 'http://www.motochanic.com/product_images/m/396/wp154b_flat__29826.jpg', '', '', '0', '2014-09-02 19:45:07');
