INSERT INTO `datafeed` VALUES ('27375', '2654', 'Olympia', 'Olympia Women\'s Pro Max 2 Over Pants', 'WP206B-10', '<p><a href=\"/olympia-size-chart/\"><img src=\"http://static.motochanic.com/i/w/sizing/size-chart-ruler.png\" alt=\"Size Chart\"></a></p><p><span>Designed to coordinate with our ladies AST jacket, the Pro Max can be worn as a stand alone riding pant or as a full over pant. Stormy rides are no match for it&rsquo;s coated Cordura&reg; shell and waterproof / breathable seam sealed membrane. Standing, boot on entry is a snap as side leg zippers extend all the way to the waistband. Two rear snap pockets and two zippered front pockets offer handy storage for personal items. Custom fit detailing is offered through adjustable knee armor positions, side stretch hip panels and EZ hem bottoms. As the mercury drops, you&rsquo;ll stay toasty as this style also offers a Thermolite&reg; insulated liner pant that doubles as great looking, stand alone sportswear.</span></p><ul><li>Outer shell constructed in coated 500 and 2000 denier Cordura&reg; fabric</li><li>Waterproof/breathable membrane adds double waterproof protection</li><li>&nbsp;Removable Thermolite&reg; insulated liner pant</li><li>&nbsp;Full side leg zippers extend to waistband</li><li>&nbsp;Storm placket front fly detail</li><li>&nbsp;Removable and adjustable height CE Motion Flex armor at knees</li><li>&nbsp;Cool mesh airflow lining</li><li>&nbsp;Removable EVA compression foam at hips</li><li>&nbsp;Custom Fit detailing at waist, hips and bottom hem</li><li>&nbsp;3M Scotchlite&reg; reflective piping side leg detail</li><li>&nbsp;Relaxed tailored fit</li><li>&nbsp;4 storage pockets</li><li>&nbsp;8&rdquo; connecting zipper for jackets</li></ul>', '9', 'sku', 'N', '249.99', '249.99', '0.00', '10', '', '', 'female', 'http://www.motochanic.com/olympia-womens-pro-max-2-over-pants/', 'http://www.motochanic.com/product_images/a/417/wp206b_flat__11407.jpg', '', '', '0', '2014-09-02 19:45:07');
