INSERT INTO `datafeed` VALUES ('5401', '5401', 'Givi', 'Givi Z2228 3-Case Lock', 'Z228', '<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Givi Z2228 3-Case Lock</strong></span></p> <p><span style=\"font-size: small;\">This lock set includes three lock cylinders to match the keys for three Givi cases - for example, two sidecases and a topcase.</span></p> <p><span style=\"font-size: small;\">Easy to install using a small screwdriver. Includes two keys per cylinder (six total matching keys). Keys or locks cannot be supplied by specific key numbers, as all orders are random. Lock sets of the same number are only available in a maximum of three locks per set.&nbsp;</span><br /><br /><span style=\"font-size: small;\">Note: When installing the Z228 replacement lock cylinder in the Givi E52 topcase, you must replace the E52\'s original cylinder sleeves with those included with the Givi Z228 kit. The original cylinder sleeves can be extracted from the E52 by gravity (or lightly tapping with a dowel/hammer, if gravity isn\'t strong enough) once the original cylinder is removed, as the sleeve is only held in place by friction.&nbsp;</span><br /><br /><br /></p>', '7', 'simple', 'N', '32.00', '32.00', '0.00', '', '', '', '', 'http://www.motochanic.com/givi-z2228-3-case-lock/', 'http://www.motochanic.com/product_images/y/713/z228__81599.JPG', '', '', '0', '2014-09-02 19:44:04');
